import{_ as r,o,c as t,z as e,a}from"./chunks/framework.9482e208.js";const g=JSON.parse('{"title":"§ 15.2-1623 Judgment for officer or sureties against deputy, etc., when officer liable for misconduct of deputy.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/15.2-1623.md","filePath":"vacode/15.2-1623.md"}'),i={name:"vacode/15.2-1623.md"},s=e("h1",{id:"§-15-2-1623-judgment-for-officer-or-sureties-against-deputy-etc-when-officer-liable-for-misconduct-of-deputy",tabindex:"-1"},[a("§ 15.2-1623 Judgment for officer or sureties against deputy, etc., when officer liable for misconduct of deputy. "),e("a",{class:"header-anchor",href:"#§-15-2-1623-judgment-for-officer-or-sureties-against-deputy-etc-when-officer-liable-for-misconduct-of-deputy","aria-label":'Permalink to "§ 15.2-1623 Judgment for officer or sureties against deputy, etc., when officer liable for misconduct of deputy."'},"​")],-1),n=e("p",null,"If any deputy of a sheriff or other officer commits any default or misconduct in office for which his principal or the personal representative of such principal is liable, or for which a judgment or decree shall be recovered against either, the principal or his personal representative may, on motion, obtain a judgment against such deputy and his sureties, and their personal representatives, for the full amount for which such principal or his personal representative may also be so liable or for which such judgment or decree may have been rendered. However, no judgment shall be rendered by virtue of this section for money for which any other judgment or decree has been previously rendered against such deputy or his sureties or their personal representatives.",-1),c=e("p",null,"Code 1950, § 15-521; 1962, c. 623, § 15.1-86; 1971, Ex. Sess., c. 155; 1997, c. 587.",-1),d=[s,n,c];function f(u,h,l,p,m,y){return o(),t("div",null,d)}const b=r(i,[["render",f]]);export{g as __pageData,b as default};
